import React, { useRef, useState, useEffect } from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import './ServicesMenu.css';
import 'swiper/css';
import 'swiper/css/free-mode';
import { FreeMode } from 'swiper/modules';
import menuData from "../../data/services.json";

const ServicesMenu = () => {
    const [fixed, setFixed] = useState(false);
    const wrapperMenuRef = useRef(null);
    const swiperRef = useRef(null);
    const [activeIndex, setActiveIndex] = useState(null);
    const sectionRefs = useRef({});

    // Utility to extract service name from URL
    const extractServiceNameFromUrl = (url) => {
        const matches = url.match(/\/([^\/]+)$/);
        return matches ? matches[1] : null;
    };

    useEffect(() => {
        const handleScroll = () => {
            const block = wrapperMenuRef.current;
            const blockTop = block.getBoundingClientRect().top;
            const firstBlockHeight = document.querySelector(".header-wrapper .content").offsetHeight;

            setFixed(blockTop < firstBlockHeight);

            let currentSection = null;
            Object.keys(sectionRefs.current).forEach(key => {
                const section = sectionRefs.current[key];
                const rect = section.getBoundingClientRect();
                if (rect.top <= 120 && rect.bottom >= 120) {
                    currentSection = key;
                }
            });

            if (currentSection !== null && currentSection !== activeIndex) {
                setActiveIndex(currentSection);
            }
        };

        const addEventListeners = () => {
            window.addEventListener('scroll', handleScroll);
        };

        const removeEventListeners = () => {
            window.removeEventListener('scroll', handleScroll);
        };

        const initIntersectionObserver = () => {
            const observerOptions = {
                root: null,
                rootMargin: '-110px 0px -99% 0px',
                threshold: [0, 1],
            };

            const observer = new IntersectionObserver((entries) => {
                entries.forEach(entry => {
                    if (entry.isIntersecting) {
                        const id = entry.target.getAttribute('id');
                        setActiveIndex(id);
                        window.history.replaceState(null, null, `/${id}`);
                        scrollToSlide(id);
                    }
                });
            }, observerOptions);

            menuData.forEach(service => {
                const element = document.getElementById(service.id);
                if (element) {
                    observer.observe(element);
                    sectionRefs.current[service.id] = element;
                }
            });

            return observer;
        };

        const observer = initIntersectionObserver();
        addEventListeners();

        // Scroll to service if it's in the URL on initial load
        const serviceName = extractServiceNameFromUrl(window.location.pathname);
        if (serviceName) {
            const element = document.getElementById(serviceName);
            if (element) {
                const yOffset = -100; // Height of header
                const yCoordinate = element.getBoundingClientRect().top + window.pageYOffset + yOffset;
                window.scrollTo({ top: yCoordinate, behavior: 'smooth' });
                setActiveIndex(serviceName);
            }
        }

        return () => {
            removeEventListeners();
            observer.disconnect();
        };
    }, [activeIndex]);

    const scrollToSlide = (id) => {
        const index = menuData.findIndex(service => service.id === id);
        if (swiperRef.current && swiperRef.current.swiper) {
            swiperRef.current.swiper.slideTo(index, 1000, false);
        }
    };

    const handleClick = (id) => {
        setActiveIndex(id);
        scrollToSlide(id);
        const element = document.getElementById(id);
        if (element) {
            const yOffset = -100; // Height of header
            const yCoordinate = element.getBoundingClientRect().top + window.pageYOffset + yOffset;
            window.scrollTo({ top: yCoordinate, behavior: 'smooth' });
            window.history.pushState(null, null, `/${id}`);
        }
    };

    return (
        <div className='servicesmenu-wrapper' ref={wrapperMenuRef}>
            <div className={`fallback ${fixed ? 'fixed' : ''}`} style={{ height: '39px' }} />
            <div className={`servicesmenu ${fixed ? "fixed" : ""}`} style={{ top: fixed ? `${document.querySelector(".header-wrapper .content").offsetHeight}px` : '' }}>
                <div className='content'>
                    <Swiper
                        slidesPerView={'auto'}
                        freeMode={true}
                        modules={[FreeMode]}
                        centeredSlides={true}
                        centeredSlidesBounds={true}
                        ref={swiperRef}
                    >
                        {menuData.map(service => (
                            <SwiperSlide className={`item`} key={service.id}>
                                <a
                                    key={service.id}
                                    href={`/${service.id}`}
                                    className={`${activeIndex === service.id ? 'active-service' : ''}`}
                                    onClick={(e) => {
                                        e.preventDefault(); // Disable default link behavior
                                        handleClick(service.id);
                                    }}
                                >
                                    {service.name}
                                </a>
                            </SwiperSlide>
                        ))}
                    </Swiper>
                </div>
            </div>
        </div>
    );
};

export default ServicesMenu;
